import React from 'react';
import AppContext from '../context';

function Header() {

  const {onOpenMenu, menuOpened} = React.useContext(AppContext);

  return(
    <header className={menuOpened ? 'contentHeader contentHeaderOpened' : 'contentHeader'}>
    <div className="headerTop a-c">
    <div className="headerLeft">
    {menuOpened ? <img onClick={onOpenMenu} width="26" src="./images/close.svg" alt="menu" /> :
    <img onClick={onOpenMenu} width="24" src="./images/menu.svg" alt="menu" />
    }
    </div>
    <div className="headerCenter">
    <a href="/"></a>
    </div>
    <div className="headerRight">
      <div className="bag a-c j-c">
        <span className="bagQuantity">0</span>
      </div>
    </div>
    </div>
  </header>
  )
}

export default Header;
